-- Down script
-- Part 1: Drop the database if it exists
USE master;
DECLARE @dbid INT;
SET @dbid = DB_ID('MBM3');

-- Check if the database exists before setting it to single-user mode
IF @dbid IS NOT NULL
BEGIN
    -- Set the database to single-user mode
    ALTER DATABASE [MBM3] SET SINGLE_USER WITH ROLLBACK IMMEDIATE;
    -- Drops the database
    DROP DATABASE [MBM3];
END
ELSE
BEGIN
    PRINT 'Database does not exist.';
END
GO

CREATE DATABASE MBM3;
GO

USE MBM3;

-- Create tables
DROP TABLE IF EXISTS directors;
CREATE TABLE directors (
    director_id INT NOT NULL IDENTITY(1,1),
    director_name VARCHAR(40),
    PRIMARY KEY (director_id)
);

DROP TABLE IF EXISTS producers;
CREATE TABLE producers (
    producer_id INT NOT NULL IDENTITY(1,1),
    producer_name VARCHAR(40),
    PRIMARY KEY (producer_id)
);

DROP TABLE IF EXISTS locations;
CREATE TABLE locations (
    location_id INT NOT NULL IDENTITY(1,1),
    location_name VARCHAR(40),
    location_cost DECIMAL(10,2),
    PRIMARY KEY (location_id)
);

DROP TABLE IF EXISTS crews;
CREATE TABLE crews (
    crew_id INT NOT NULL IDENTITY(1,1),
    crew_name VARCHAR(40),
    crew_skill_level VARCHAR(40),
    crew_salary DECIMAL(10,2),
    PRIMARY KEY (crew_id)
);

DROP TABLE IF EXISTS casts;
CREATE TABLE casts (
    cast_id INT NOT NULL IDENTITY(1,1),
    cast_name VARCHAR(50),
    cast_gender VARCHAR(50),
    cast_age INT,
    cast_experience_level INT,
    cast_salary DECIMAL(10,2),
    PRIMARY KEY (cast_id)
);

DROP TABLE IF EXISTS movies;
CREATE TABLE movies(
    movie_id INT NOT NULL IDENTITY(1,1),
    movie_name VARCHAR(40),
    movie_genre VARCHAR(40), 
    movie_budget VARCHAR(40),
    movie_producer_id INT,
    movie_director_id INT,
    movie_location_id INT,
    PRIMARY KEY (movie_id),
    FOREIGN KEY (movie_producer_id) REFERENCES producers(producer_id),
    FOREIGN KEY (movie_director_id) REFERENCES directors(director_id),
    FOREIGN KEY (movie_location_id) REFERENCES locations(location_id)
);

DROP TABLE IF EXISTS movie_crew;
CREATE TABLE movie_crew (
    movie_crew_id INT NOT NULL,
    movie_id INT NOT NULL,
    crew_id INT NOT NULL,
    FOREIGN KEY (crew_id) REFERENCES crews(crew_id),
    FOREIGN KEY (movie_id) REFERENCES movies(movie_id)
);


DROP TABLE IF EXISTS movie_cast;
CREATE TABLE movie_cast (
    movie_id INT NOT NULL,
    cast_id INT NOT NULL,
    FOREIGN KEY (cast_id) REFERENCES casts(cast_id),
    FOREIGN KEY (movie_id) REFERENCES movies(movie_id)
);




-- MBM3 INSERT DATA

USE MBM3;
DECLARE @tableName NVARCHAR(MAX);
-- Drop foreign key constraints
DECLARE fkCursor CURSOR FOR
SELECT 'ALTER TABLE ' + table_name + ' DROP CONSTRAINT ' + constraint_name
FROM information_schema.table_constraints
WHERE constraint_type = 'FOREIGN KEY';
OPEN fkCursor;
FETCH NEXT FROM fkCursor INTO @tableName;
WHILE @@FETCH_STATUS = 0
BEGIN
    EXEC sp_executesql @tableName;

    FETCH NEXT FROM fkCursor INTO @tableName;
END
CLOSE fkCursor;
DEALLOCATE fkCursor;
-- Drop tables
DECLARE tableCursor CURSOR FOR
SELECT table_name
FROM information_schema.tables
WHERE table_type = 'BASE TABLE';
OPEN tableCursor;
FETCH NEXT FROM tableCursor INTO @tableName;
WHILE @@FETCH_STATUS = 0
BEGIN
    DECLARE @sql NVARCHAR(MAX);
    SET @sql = 'DROP TABLE ' + @tableName;
    EXEC sp_executesql @sql;

    FETCH NEXT FROM tableCursor INTO @tableName;
END

CLOSE tableCursor;
DEALLOCATE tableCursor;
